import React from "react";
import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Bio from "./components/Bio/Bio";

function App() {
  return (
    <div className="App">
      <div>
        <h3>Skills</h3>
        <ul>
          <li>JavaScript</li>
          <li>WordPress</li>
          <li>ReactJs</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
